import './App.scss';

import { Table } from './components/Table';
import { PopupCharts } from './components/PopupCharts';

import datas from './assets/data.json';

function App() {
  return (
    <div className="App font-open-sans">
      <Table datas={datas} />
      <PopupCharts />
    </div>
  );
}

export default App;
